const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>Job</th>
      </tr>
    </thead>
  )
}

const TableBody = () => {
  return (
    <tbody>
    </tbody>
  )
}
class Table1 extends React.Component {
  render() {
    return (
      <div>
        <table>
          <TableHeader />
          <TableBody />
        </table>
      </div>
    );
  }
}

export default Table1;
